using System.Text;

namespace DataStructure.Algo.Greedy;

public class _402_RemoveKdigits
{
    #region 会超时

    public string RemoveKdigits1(string num, int k)
    {
        var strNum = new StringBuilder(num);
        for (int i = 0; i < k; i++)
        {
            bool IsDelete = false;
            for (int j = 1; j < strNum.Length; j++)
            {
                if (strNum[j] < strNum[j - 1])
                {
                    strNum.Remove(j - 1, 1);
                    IsDelete = true;
                    break;
                }
            }

            if (!IsDelete) strNum.Remove(strNum.Length - 1, 1);
        }

        int len = strNum.Length;
        while (len != 0)
        {
            if (strNum[0] > '0') break;
            strNum.Remove(0, 1);
            len = strNum.Length;
        }

        return strNum.Length == 0 ? "0" : strNum.ToString();
    }

    #endregion

    #region 优化

    public string RemoveKdigits(string num, int k)
    {
        if (k==num.Length)
            return "0";
        
        var stack = new Stack<char>();
        for (int i = 0; i < num.Length; i++)
        {
            var c = num[i];
            while (stack.Count != 0 && k > 0 && stack.Peek() > c)
            {
                //如果栈不为空 栈顶的元素大于当前的值
                //就删除这个元素
                stack.Pop();
                k--;
            }

            stack.Push(c);
        }

        //k还有的情况就把栈顶的全删除了
        for (int i = 0; i < k; i++)
        {
            stack.Pop();
            k--;
        }

        var sb = new StringBuilder();
        while (stack.Count != 0)
        {
            // var c = stack.Pop();
            // sb.Append(c);
            sb.Insert(0, stack.Pop());
        }

        // sb = new StringBuilder(new string(sb.ToString().Reverse().ToArray()));
        //
        // // 删除前面是 0 的字符
        // int len = sb.Length;
        // while (len != 0)
        // {
        //     if (sb[0] > '0') break;
        //     sb.Remove(0, 1);
        //     len = sb.Length;
        // }

        while (sb.Length>1&&sb[0]=='0')
        {
            sb.Remove(0, 1);
        }

        return sb.ToString();
    }

    #endregion

    public static void Test()
    {
        string num = "1432219";

        #region 测试用例

        string num2 =
            "";

        #endregion

        var removeKdigits = new _402_RemoveKdigits().RemoveKdigits(num2, 100000);
        Console.WriteLine(removeKdigits);
    }
}